import React, { Component } from "react";

class RadioButton extends Component {
  render() {
    const { value, handleGenerico } = this.props;

    return (
      <div>
        <div className="checkbox">
          <label htmlFor="">
          <input
            type="radio"
            name="casa"
            value={value}
            onChange={handleGenerico}
            />
          <input
            type="radio"
            name="ap"
            value={value}
            onChange={handleGenerico}
          />


          </label>
        </div>
      </div>
    );
  }
}

export default RadioButton;
